const productOfDivisible = (nums, m) => {
    return nums.filter(num => num % m === 0).reduce((a, b) => a * b, 1);
}

javascript.Example2:
const genRotations = (s) => {
    return Array.from({length: s.length - 1}, (_, i) => s.substring(i + 1) + s.substring(0, i + 1));
}

const sumOfRotations = (s) =>{
    return genRotations(s).map(r => parseInt(r)).reduce((a, b) => a + b);
}
